import axios from 'axios'
import { useState } from 'react'
import {Form, Button} from 'react-bootstrap'
import {BASE_URL} from '../../App'

const LoginModal = (props) => {
    const [input, setInput] = useState(null)

    const handleChange = (e) => {
        console.log(BASE_URL);
        setInput({...input, [e.target.name] : e.target.value})
    }
    const logIn = (e) => {
        e.preventDefault()
        // axios.post()
    }
    return (
        <>
        <span onClick={props.closeLogin}>X</span>
        <h2 style={{textAlign: 'center', color: '#ffc55a'}}>Login</h2>
        <Form className ='login-form' onSubmit={logIn}>
            <Form.Control name="email" placeholder="Email" onChange={e=>handleChange(e)}/>
            <Form.Control type="password" name="password" placeholder="Password" onChange={e=>handleChange(e)}/>
            <Button> Login </Button>
        </Form>
        </>
    )
}

export default LoginModal
